// src/pages/TradeInterface.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { SocketContext } from '../SocketContext';

const TradeInterface = ({ user, onlineUsers }) => {
    const [listings, setListings] = useState([]);
    const [otherProducts, setOtherProducts] = useState([]);
    const [selectedListing, setSelectedListing] = useState(null);
    const [selectedProduct, setSelectedProduct] = useState('');
    const [message, setMessage] = useState('');
    const socket = useContext(SocketContext);
    const fetchListings = async () => {
        try {
            const res = await axios.get('http://localhost:5000/api/trade-listings');
            setListings(res.data);
        } catch (err) {
            console.error('Error fetching trade listings:', err);
        }
    };

    const fetchOtherProducts = async () => {
        try {
            const res = await axios.get('http://localhost:5000/api/products');
            // Exclude user's own products
            const filtered = res.data.filter(product => product.offeredBy !== user.username);
            setOtherProducts(filtered);
        } catch (err) {
            console.error('Error fetching other products:', err);
        }
    };

    useEffect(() => {
        fetchListings();
        fetchOtherProducts();
    }, []);

    const handleTradeRequest = (listing) => {
        setSelectedListing(listing);
        setMessage('');
    };

    const handleSendRequest = async () => {
        if (!selectedProduct) {
            setMessage('Please select a product to trade.');
            return;
        }
        try {
            // Create Trade (for demo purposes)
            const tradeData = {
                offeredBy: user.username,
                acceptedBy: selectedListing.offeredBy,
                productOffered: selectedProduct,
                productGotten: selectedListing.name
            };
            await axios.post('http://localhost:5000/api/trades', tradeData);

            // Emit trade request via Socket.io
            socket.emit('trade_request', tradeData);

            setMessage('Trade request sent!');
            // Remove the listing from view
            setListings(listings.filter(l => l._id !== selectedListing._id));
            setSelectedListing(null);
        } catch (err) {
            console.error('Error sending trade request:', err);
            setMessage('Error sending trade request.');
        }
    };

    return (
        <div>
            <h2 className="text-xl mb-4">Trade Interface</h2>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                {listings.map(listing => {
                    const isOnline = onlineUsers[listing.offeredBy];
                    return (
                        <div 
                            key={listing._id} 
                            className={`p-4 border rounded cursor-pointer ${isOnline ? 'bg-green-200' : 'bg-gray-200'}`} 
                            onClick={() => isOnline && handleTradeRequest(listing)}
                        >
                            <p><strong>Name:</strong> {listing.name}</p>
                            <p><strong>Price:</strong> {listing.price} ETH</p>
                            <p><strong>Offered By:</strong> {listing.offeredBy}</p>
                        </div>
                    );
                })}
            </div>

            {selectedListing && (
                <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center">
                    <div className="bg-white p-6 rounded">
                        <h3 className="text-lg mb-2">Trade with {selectedListing.offeredBy}</h3>
                        <p><strong>Listing:</strong> {selectedListing.name}</p>
                        <select 
                            value={selectedProduct} 
                            onChange={e => setSelectedProduct(e.target.value)} 
                            className="w-full p-2 border rounded mb-4"
                        >
                            <option value="">Select Your Product</option>
                            {otherProducts.map(product => (
                                <option key={product._id} value={product.name}>
                                    {product.name} ({product.quantity} available)
                                </option>
                            ))}
                        </select>
                        {message && <p className="mb-2 text-red-500">{message}</p>}
                        <button 
                            onClick={handleSendRequest} 
                            className="bg-blue-500 text-white p-2 rounded mr-2"
                        >
                            Send Trade Request
                        </button>
                        <button 
                            onClick={() => setSelectedListing(null)} 
                            className="bg-gray-500 text-white p-2 rounded"
                        >
                            Cancel
                        </button>
                    </div>
                </div>
            )}
        </div>
    );
};

export default TradeInterface;
